%[text] # Chapter 1 Exercises
%[text] ## Exercise 1.1
function [t, y] = euler(f, tspan, y0, h)

nsteps = floor((tspan(2) - tspan(1)) / h);
m = length(y0);
t = zeros(1, nsteps + 1);
y = zeros(nsteps + 1, m);

t(1) = tspan(1);
y(1,:) = y0;

for n = 1 : length(t) - 1
    y(n+1,:) = y(n,:) + h * f(t(n), y(n,:));
    t(n+1) = t(n) + h;
end

end
%[text] 
% Define ODE function
f = @(t, y) 1 - exp(-t) - y;

% Define IVP parameters
tspan = [0, 4];    % boundaries of the t domain
y0 = 1;          % initial values
h = 0.4;           % step length

% Solve the IVP using the Euler method
[t, y] = euler(f, tspan, y0, h);

% Define exact solution
exact = @(t, y) 1 - t .* exp(-t);

% Calculate exact solution over lots of values of t
texact = linspace(0, 4, 100);
yexact = exact(texact);

% Plot solution
clf %[output:10ebd0a5]
hold on %[output:10ebd0a5]
plot(texact, yexact, 'k-', LineWidth=1) %[output:10ebd0a5]
plot(t, y(:,1), 'b-o', LineWidth=1, MarkerFaceColor='b') %[output:10ebd0a5]
hold off %[output:10ebd0a5]
xlabel('$t$', Interpreter='latex') %[output:10ebd0a5]
ylabel('$y(t)$', Interpreter='latex') %[output:10ebd0a5]
legend('Exact', 'Euler') %[output:10ebd0a5]
axis padded %[output:10ebd0a5]
%[text] (b)
% Plot exact solution
clf %[output:58438569]
h(1) = plot(texact, yexact, 'k-', LineWidth=1); %[output:58438569]
hold on %[output:58438569]

% Loop through h values and plot solution
hvals = [0.4, 0.2, 0.1, 0.05];
for i = 1 : length(hvals)
    [t, y] = euler(f, tspan, y0, hvals(i));
    h(i+1) = plot(t, y(:, 1), '-o'); %[output:58438569]
end

hold off %[output:58438569]
xlabel('$t$', Interpreter='latex') %[output:58438569]
ylabel('$y(t)$', Interpreter='latex') %[output:58438569]
legend(h, {'Exact', 'h = 0.4', 'h = 0.2', 'h = 0.1', 'h = 0.05'}, Location="southeast") %[output:58438569]
axis padded %[output:58438569]
%[text] (c)
if true % used to keep printed lines together %[output:group:9b1f6690]

    errors = [];    % empty list for the errors

    % Print column headings
    fprintf("|  h   |  Euler   |   GTE    |") %[output:1adbb0c4]
    fprintf("|:----:|:--------:|:--------:|") %[output:946bbe46]

    % Loop through solutions
    for i = 1 : length(hvals)
        [t, y] = euler(f, tspan, y0, hvals(i));
        [~, idx] = min(abs(t - 2));
        errors = [errors, abs(y(idx,1) - exact(t(idx)))];
        fprintf("| %0.2f | %0.6f | %0.2e |\n", hvals(i), y(idx,1), errors(i)) %[output:95646996]
    end
end %[output:group:9b1f6690]
%[text] (d)
clf %[output:06169faa]
plot(hvals, errors, 'b-o', LineWidth=1, MarkerFaceColor='b') %[output:06169faa]
xlabel("$h$", Interpreter="latex") %[output:06169faa]
ylabel("GTE") %[output:06169faa]
axis padded %[output:06169faa]
