%[text] ## Exercise 1.2
% Define ODE function
pendulum = @(t, y, L, g) [ y(2), -g / L * sin(y(1)) ];

% Define IVP parameters
tspan = [0, 10];    % boundaries of the t domain
y0 = [pi / 2, 0];   % initial values
L = 1;              % length of pendulum
g = 9.81;           % gravity
h = 0.0001;         % step length

% Solve the IVP using the Euler method
[t, y] = euler(@(t, y)pendulum(t, y, L, g), tspan, y0, h);

% Plot solution
clf %[output:40d6e8f3]
plot(t, y(:,1), 'b-', LineWidth=1) %[output:40d6e8f3]
xlabel('$t$', Interpreter='latex') %[output:40d6e8f3]
ylabel('$\theta(t)$', Interpreter='latex') %[output:40d6e8f3]
title('$\ddot{\theta} + \frac{g}{L}\sin(\theta)=0$, $\theta(0) = 1$', Interpreter='latex') %[output:40d6e8f3]
axis padded %[output:40d6e8f3]
%%
%[text] ## Exercise 1.3
%[text] (a)
% Define ODE function
predator_prey = @(t, y, a, b, c, d) [ a * y(1) - b * y(1) * y(2), -c * y(2) + d * y(1) * y(2) ];

% Define IVP parameters
tspan = [0, 100];   % boundaries of the t domain
y0 = [5, 5];        % initial values
a = 0.1;            % rabbit birth rate
b = 0.02;           % rabbit death rate
c = 0.4;            % fox birth rate
d = 0.04;           % fox death rate
h = 0.01;           % step length

% Solve the IVP using the Euler method
[t, y] = euler(@(t, y)predator_prey(t, y, a, b, c, d), tspan, y0, h);

% Plot solution
clf %[output:86263ff3]
hold on %[output:86263ff3]
plot(t, y(:,1), 'b-', LineWidth=1) %[output:86263ff3]
plot(t, y(:,2), 'r-', LineWidth=1) %[output:86263ff3]
hold off %[output:86263ff3]
xlabel('$t$', Interpreter='latex') %[output:86263ff3]
ylabel('Population') %[output:86263ff3]
title('Lotka-Volterra Model') %[output:86263ff3]
legend('Rabbit', 'Foxes', Location='northwest') %[output:86263ff3]
axis padded %[output:86263ff3]
%[text] (b)
% Use smaller step length to increase accuracy
h = 0.001;

clf %[output:7a2f74fd]
hold on %[output:7a2f74fd]
for i = 1 : 6
    [t, y] = euler(@(t, y)predator_prey(t, y, a, b, c, d), tspan, y0, h);
    hi(i) = plot(y(:,1), y(:,2), LineWidth=1); %[output:7a2f74fd]
    plot(y0(1), y0(2), 'ko', MarkerFaceColor='k')
    y0 = y0 + [5, 5];
end
hold off %[output:7a2f74fd]
xlabel("Rabbits") %[output:7a2f74fd]
ylabel("Foxes") %[output:7a2f74fd]
legend(hi, {'(5,5)', '(10, 10)', '(15, 15)', '(20, 20)', '(25, 25)', '(30, 30)'}) %[output:7a2f74fd]

